	hex2ByteArray(seedKeyHex, (unsigned char*)seedKey, 16);

	//printf("bpFileLen1:%s,cipherPbKeyLen:%d\n", bpFileLen,cipherPbKeyLen);

	unsigned char pbKey[1024];
	decryptPbKey(cipherPbKey, cipherPbKeyLen, clientSN, seedKey, pbKey);

	//printf("bpFileLen2:%s,pbLen:%d\n", bpFileLen,pbLen);
